import "./Banner.scss";
export const Banner = () => {
  return (
    <div className="banner-page">
      <div className="banner-section">
        <div>Banner</div>
        <img alt="search" src={require("../../image/dd.jpg")} />
        <img alt="search" src={require("../../image/tt.jpg")} />

      </div>
    </div>
  );
};
